// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className=" flex items-center justify-center bg-green-900">
     <div className=" w-full h-full sm:w-[60%] sm:h-[60%] p-5 rounded-lg bg-zinc-700 shadow-xl">
      <div className=" flex h-[30px] text-center">
      <div className='text-2xl text-neutral-300 font-bold hover:text-green-700 transition-all hover:transition-all cursor-pointer w-auto'>Developer</div>
        <div className="flex w-full h-full justify-center items-center gap-10">
        <span className="text-lg text-neutral-300 font-bold hover:text-green-700 transition-all hover:transition-all cursor-pointer w-auto">Home</span>
        <span className="text-lg text-neutral-300 font-bold hover:text-green-700 transition-all hover:transition-all cursor-pointer w-auto">About</span>
        <span className="text-lg text-neutral-300 font-bold hover:text-green-700 transition-all hover:transition-all cursor-pointer w-auto">Skill</span>
        <span className="text-lg text-neutral-300 font-bold hover:text-green-700 transition-all hover:transition-all cursor-pointer w-auto">Experience</span>
        </div>
        <span className='text-neutral-300 font-bold hover:text-green-700 transition-all hover:transition-all cursor-pointer w-auto'>Contact</span>
      </div>
     </div>
    </div>
  );
}

export default App;
